import React, { useState } from "react";

const readFile = (file: Blob): string[] => {
  const reader = new FileReader();

  reader.readAsText(file);
  reader.onerror = () => {
    alert("error");
  };

  const content = reader.result as string;

  return content.split("\n");
};

export default readFile;
